  return (
    <div className="App">
      <h1 className="text-3xl font-bold underline">Hello world!</h1>
      <div class="grid-container">
        <Leftbar></Leftbar>
        <Gallery class="gallery"></Gallery>
      </div>
    </div>
  );
}

export default App;
